import styled from 'styled-components'

export const Card = styled.div`
    background: ${props => `url(${props.img}) no-repeat top center`};
    border-radius: 5;
    padding: 75px 50px;
    margin: 0px 25px;
    width: 100%
    box-shadow: 20px 20px 20px black;
    display: flex;
    justify-content: center;
    height: 100%;
`
